// src/Dashboard.js
import React from 'react';
import { Container, Typography } from '@mui/material';
import Inventory from './Inventory'; // Import Inventory component
import LabelPrinter from './LabelPrinter'; // Import LabelPrinter component

const Dashboard = () => {
    return (
        <Container>
            <Typography variant="h4" gutterBottom>
                Dashboard
            </Typography>
            <Inventory /> {/* Render Inventory component */}
            <div style={{ margin: '40px 0' }} /> {/* Add space between components */}
            <LabelPrinter /> {/* Render LabelPrinter component */}
        </Container>
    );
};

export default Dashboard;
